import React from 'react';
//import './picture.css';
import './part3.css'


const Part3=(props)=>(
    <div className='Part3'>
    <select name="Years">
    <option value="1">1</option>
    <option value="2">2</option>
    <option value="3">3</option>
    <option value="4">4</option>
    </select>



  <h>Month</h>
  <select name="Months">
    <option value="1">1</option>
    <option value="2">2</option>
    <option value="3">3</option>
    <option value="4">4</option>
  </select>
    </div>
);
    export default Part3;
